import React from 'react'
import { Navigate } from 'react-router-dom'
import { AuthConsumer } from '../helper/AuthContext'
import Home from './../pages/Home'

function ProtectedRoute({ path }) {
    return (
        <AuthConsumer>
            {({ isAuth }) => (
                <>
                    {isAuth ? (
                        <Home />
                    ) : (
                        () => {
                            switch (path) {
                            }
                        }
                    )}
                </>
            )}
        </AuthConsumer>
    )
}

export default ProtectedRoute
